    /*
    1162. 地图分析
    你现在手里有一份大小为 N x N 的『地图』（网格） grid，上面的每个『区域』（单元格）都用 0 和 1 标记好了。其中 0 代表海洋，1 代表陆地，你知道距离陆地区域最远的海洋区域是是哪一个吗？请返回该海洋区域到离它最近的陆地区域的距离。
    我们这里说的距离是『曼哈顿距离』（ Manhattan Distance）：(x0, y0) 和 (x1, y1) 这两个区域之间的距离是 |x0 - x1| + |y0 - y1| 。
    如果我们的地图上只有陆地或者海洋，请返回 -1。

    示例 1：
    输入：[[1,0,1],[0,0,0],[1,0,1]]
    输出：2
    解释：
    海洋区域 (1, 1) 和所有陆地区域之间的距离都达到最大，最大距离为 2。

    示例 2：
    输入：[[1,0,0],[0,0,0],[0,0,0]]
    输出：4
    解释：
    海洋区域 (2, 2) 和所有陆地区域之间的距离都达到最大，最大距离为 4。

    提示：
    1 <= grid.length == grid[0].length <= 100
    grid[i][j] 不是 0 就是 1
     */

    /**
     * 提交超时
     * 27 / 35 个通过测试用例
     */
    class Solution_1 {

        public int maxDistance(int[][] grid) {
            List<int[]> ground = new ArrayList<>();
            List<int[]> ocean = new ArrayList<>();
            for (int i = 0; i < grid.length; i++) {
                int[] row = grid[i];
                for (int j = 0; j < row.length; j++) {
                    if (row[j] == 1) {
                        ground.add(new int[] {i, j});
                    }
                    else {
                        ocean.add(new int[] {i, j});
                    }
                }
            }

            if (ground.isEmpty() || ocean.isEmpty()) {
                return -1;
            }

            int maxDis = -1;
            for (int[] oceanPos : ocean) {
                int minDis = Integer.MAX_VALUE;
                for (int[] groundPos : ground) {
                    minDis = Math.min(minDis, Math.abs(oceanPos[0] - groundPos[0]) + Math.abs(oceanPos[1] - groundPos[1]));
                }
                if (minDis > maxDis) {
                    maxDis = minDis;
                }
            }
            return maxDis;
        }

    }

    /**
     * 105ms
     * 以海洋格子为中心，在周围搜索距离最近的陆地
     */
    class Solution {

        public int maxDistance(int[][] grid) {
            boolean hasGround = false;
            List<int[]> ocean = new ArrayList<>();
            int size = grid.length;
            for (int i = 0; i < size; i++) {
                int[] row = grid[i];
                for (int j = 0; j < size; j++) {
                    if (row[j] == 1) {
                        hasGround = true;
                    }
                    else {
                        ocean.add(new int[] {i, j});
                    }
                }
            }
            if (!hasGround || ocean.isEmpty()) {
                // 只有陆地或者只有海
                return -1;
            }

            int maxDis = 0;
            for (int[] oceanItem : ocean) {
                int dis = 1;
                while (true) {
                    boolean groundFound = false;
                    for (int i = -dis; i <= dis; i++) {
                        int deltaRow = dis - Math.abs(i);
                        int col = oceanItem[1] + i;
                        if (col >= 0 && col < size) {
                            {
                                int row = oceanItem[0] + deltaRow;
                                if (row >= 0 && row < size) {
                                    if (grid[row][col] == 1) {
                                        groundFound = true;
                                        break;
                                    }
                                }
                            }
                            if (deltaRow != 0) {
                                int row = oceanItem[0] - deltaRow;
                                if (row >= 0 && row < size) {
                                    if (grid[row][col] == 1) {
                                        groundFound = true;
                                        break;
                                    }
                                }
                            }
                        }
                    }
                    if (groundFound) {
                        if (maxDis < dis) {
                            maxDis = dis;
                        }
                        break;
                    }
                    dis++;
                }
            }
            return maxDis;
        }

    }

